import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "./catSwiper.scss";
import '../../../node_modules/swiper/swiper.scss';
import { EffectCards, Pagination } from "swiper";
import "swiper/css/pagination";


export default function catSwiper(passedCats) {
    return (
        <div>
            <Swiper
                pagination={{
                    type: "progressbar"
                }}
                navigation={true}
                effect={"cards"}
                grabCursor={true}
                modules={[EffectCards, Pagination]}
                className="mySwiper"
            >

                {passedCats.map((oneCat) =>
                    <SwiperSlide>
                        <div className="cat-swiper-name" key={oneCat.index}>{oneCat.name}</div>
                        <div className="cat-swiper-img" key={oneCat.index}>{oneCat.img}</div>
                        <div className="cat-swiper-url" key={oneCat.index}>{oneCat.url}</div>
                    </SwiperSlide>
                )}

            </Swiper>
        </div>
    );
}
